const App3 = () => {

    const dog = (e) => {
        const image1 = document.getElementById('image');  
        image1.setAttribute('src', 'https://images.app.goo.gl/1kAT9gWETTDKhJWh7') 
    }

    const cat = (e) => {
        e.document.getElementById(dog).setAttribute('src', './Media/cat.jpeg');
    }

    const fox = (e) => {
        e.getElementById(fox).setAttribute('src', './Media/fox.jpeg');
    }


    return (
        <div>
            <button id='dog' onClick={dog}>Dog</button>
            <button id='cat' onClick={cat}>Cat</button>
            <button id='fox' onClick={fox}>Fox</button>
            <img id='image' width='40%' height='40%' src='' ></img>
        </div>
    );
}
export default App3;
